// components/Footer.js
import React from 'react';
import { Typography } from '@mui/material';

const Footer = () => {
  return (
    <footer style={{ padding: '20px', textAlign: 'center', background: '#f0f0f0', marginTop: 'auto' }}>
      <Typography variant="body2">Amazing Tech © 2024. All rights reserved.</Typography>
      <Typography variant="body2">74 Nguyễn Cửu Đàm, P. Tân Sơn Nhì, Q. Tân Phú, Ho Chi Minh City, Vietnam

</Typography>
    </footer>
  );
};

export default Footer;
